import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import './index.css';
import reportWebVitals from './reportWebVitals';
import PortfolioHeader from './pages/PortfolioHeader'
import PortfolioBody from './pages/PortfolioBody'
import LoginForm from './pages/LoginForm';
import AssetForm from './pages/AssetForm'
import TopNavigation from './pages/TopNavigation';

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<TopNavigation />}>
        <Route path="contact" element={<LoginForm />} />
        <Route path="asset" element={<AssetForm />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}
document.body.style = 'background: aquamarine;';
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);


